import React from 'react';
import Movie from './Movie';
import { movies } from '../movieDummy';

export default function MovieDetail() {
  return (
    <div>
      <div>
        {movies.results.map((movie) => {
          return <Movie title={movie.title} poster_path={movie.poster_path} />;
        })}
      </div>
    </div>
  );
}
